import styled from "styled-components";


export const Container = styled.div`
background-color: #23272a;
height: 60vh;

@media only screen 
  and (min-device-width: 320px) 
  and (max-device-width: 480px)
  and (-webkit-min-device-pixel-ratio: 2) 
  {
    display: flex;
    flex-direction: column;
    height: 80vh;
}
`

export const FooterSection = styled.div`
color: white;
padding: 100px;
justify-content: space-evenly;
align-items: center;
display: flex;
flex-direction: row;

`

export const ContentHeading = styled.h2`
font-family: 'Paytone One', sans-serif;
font-weight: 800;
font-size: 38px;
`

export const ProductContent = styled.p`
padding-bottom: 20px;
color: blue;
`

export const ProductList = styled.ul`
list-style: none;
`

export const ProductMenuItems = styled.li`
list-style: none;
padding-bottom: 10px;

&:hover{
    text-decoration: underline;
    cursor: pointer;
}
`

export const CompanyContent = styled.p`
padding-bottom: 20px;
color: blue;
`

export const CompanyList = styled.ul`
list-style: none;
`

export const CompanyMemuList = styled.li`
list-style: none;
padding-bottom: 10px;
&:hover{
    text-decoration: underline;
    cursor: pointer;
}
`

export const ResourceContent =styled.p`
padding-bottom: 20px;
color: blue;
`

export const ResourceList = styled.ul`
list-style: none;
`

export const ResourceMenuItem = styled.li`
list-style: none;
padding-bottom: 10px;
&:hover{
    text-decoration: underline;
    cursor: pointer;
}
`

export const PoliciesContent = styled.p``

export const PoliciesMenu = styled.ul``

export const PoliciesMenuItem = styled.li``


export const Flags = styled.h5``

export const SocialIcons = styled.div`
display: flex;
flex-direction: row;justify-content: space-evenly;
align-items: left;
padding-top: 20px;
`

export const ContentSection = styled.div``

export const Product = styled.div`
@media only screen 
  and (min-device-width: 320px) 
  and (max-device-width: 480px)
  and (-webkit-min-device-pixel-ratio: 2) 
  {
    display: flex;
    flex-direction: column;
}
`

export const Company = styled.div`
margin-top: 20px;
transform: translateX(-10px);

`

export const Resources  = styled.div`
transform: translateY(50px);
padding-left: -50px;
`

export const Policies = styled.div``
